import React from "react";

// reactstrap components

import { Container, Row, Col, Card, Button, CardImg, CardBody, CardTitle, CardText} from "reactstrap";

// core components

function Book(props) {
    console.log(props)
    let src = props.src.toString()
    return (

        <>
            <div>
                <Container>
                    <Row>
                        <Col>
                            <div >


                                <Card style={{ width: '18rem' }}>
                                    <CardImg variant="top" src={src} />
                                    <CardBody>
                                        <CardTitle> Sufficiently Advanced Magic</CardTitle>
                                        <CardText>
                                            <p><strong>Author:</strong> Andrew Row</p>
                                            <p><strong>Tags:</strong> Strong Magic, Monsters</p>
                                        </CardText>
                                        <Button variant="primary">Go somewhere</Button>
                                    </CardBody>
                                </Card>
                            </div>
                        </Col>


                    </Row>
                </Container>
            </div>
        </>
    );
}

export default Book;
